    false,nt"url": null,nt"notes": "Using a LH Systems ALS50 Light Detection
    And Ranging (LiDAR) system, flight lines of standard density (1.4 meter ground sample
    distance) data were collected over areas in Chambers County, TX (approximately 633
    square miles). Multiple returns were recorded for each laser pulse along with an
    intensity value for each return. The data acquisition occurred in missions between
    April 22, 2006, and June 12, 2006. The data was collected by Sanborn Mapping Company,
    Inc. for the Texas Water Development Board (TWDB) and the Federal Emergency Management
    Agency (FEMA).",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
